import React, { Component } from 'react';
import axios from 'axios'
import "bootstrap/dist/css/bootstrap.min.css";
import { Link, Router } from 'react-router-dom';

class Mealplans extends Component {
    constructor(props){
        super(props)
        const parsedMealplans = Array.from(axios.get('http://localhost:5000/mealplan'))
    
        this.state = {
            mealplanListGroup: parsedMealplans.map(plans => 
            <li><Link to="" class="list-group-item list-group-item-action">{plans.monday.name}</Link></li>)
        }
        console.log(parsedMealplans)
    }
        
    render() {
        return (
            <div class="list-group">
                {this.state.mealplanListGroup}
            </div>
            
            
        )
    }
}

export default Mealplans
